import React from "react";
import loupe from "../assets/images/loupe.png";
export default function Header() {
  return (
    <header className="header">
      <nav className="header__nav">
        <ul className="header__nav--list">
          <li className="header__nav--list-item">Home</li>
          <li className="header__nav--list-item">News</li>
          <li className="header__nav--list-item">Settings</li>
        </ul>
      </nav>
      <div className="header__search">
        <img className="header__search--img" src={loupe} alt="lupa" />
        <input className="header_search--text" type="search" />
      </div>
    </header>
  );
}
